import { BrowserRouter, Switch, Route } from "react-router-dom"
import PageFrame from '../src/component/SideBar/PageFrame';
import PageLayout from "./pages/PageLayout/PageLayout";
import Testpage2 from "./pages/TestPage/Testpage2";


function App() {
  return (
    <div>
        <BrowserRouter  basename="/Poly-1">
          <Switch>
            {/* <Route path='/Testpage2' component={Testpage2}></Route> */}
            <Route path='/' component={PageLayout}></Route>
          </Switch>
        </BrowserRouter>
    </div>
  );
}

export default App;
